import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Register</h1>
      <form>
        <input type="text" placeholder="Name" />
        <input type="email" placeholder="Email" />
        <input type="password" placeholder="Password" />
      </form>
    </div>
  );
}

export default App;
